int16_t isReceivePong = 0, isTransmitPong = 0, enableFilter = 0, isInterpolating = 0;
uint32_t interpolateIndex = 0;
int16_t filteredSigBuff[DMA_PING_PONG_BUFFER_LENGTH];

void AudioTransmitTsk(void) {
	LOG_printf(&trace, "Audio output thread init", 0, 0);
	while(1) {
		// Block until HWI Signal
		SEM_pend(&SEM_OutputAudio, SYS_FOREVER);

		// Send Signal to DAC (Write to Output Buffer)
		register int i;
		for (i = 0; i < DMA_PING_PONG_BUFFER_LENGTH; i++)
			g_dmaOutputBuffer[i + (isTransmitPong * DMA_PING_PONG_BUFFER_LENGTH)] = ((int32_t) filteredSigBuff[i]) << 16;
	}
}

void AudioProcessingTsk(void) {
	LOG_printf(&trace, "Audio processing thread init", 0, 0);
	while(1) {
		// Block until HWI Signal
		SEM_pend(&SEM_AudioProcessor, SYS_FOREVER);

		register int i;
		int16_t tempBuffer[DMA_PING_PONG_BUFFER_LENGTH];
		int16_t* val = NULL;

		if (isInterpolating) {
			// Interpolate
			if (interpolateIndex / UPSAMPLED_NUM == TV02_8KSPS_SIZE) {
				isInterpolating = 0;
				interpolateIndex = 0;
			} else {
				// Create Zero Padding (Upsample)
				for (i = 0; i < DMA_PING_PONG_BUFFER_LENGTH; i++) {
					if (!(interpolateIndex % UPSAMPLED_NUM))
						tempBuffer[i] = TV02_8ksps[interpolateIndex / UPSAMPLED_NUM];
					else tempBuffer[i] = 0;
					interpolateIndex++;
				}

				// Interpolate
				val = interpolateBuffer(tempBuffer);
			}
		} else {
			LOG_printf(&trace, "Low Pass with Filter: %d", enableFilter, 0);
			// Low Pass
			for (i = 0; i < DMA_PING_PONG_BUFFER_LENGTH; i++)
				tempBuffer[i] = (int16_t) (g_dmaInputBuffer[i + (isReceivePong * DMA_PING_PONG_BUFFER_LENGTH)] >> 16);

			if (enableFilter)
				val = filterBuffer(tempBuffer);
			else val = tempBuffer;
		}

		// Copy into filtered signal buffer
		memcpy(&filteredSigBuff[0],
				&val[0],
				DMA_PING_PONG_BUFFER_LENGTH * sizeof(filteredSigBuff[0]));
	}
}
